import React from 'react';
import ServiceCard from './ServiceCard';
import Sdata from '../data';

const Service = () => {
  return (
    <div>
      {Sdata.map((val, index) => (
        <ServiceCard key={index} img={val.img} />
      ))}
    </div>
  );
};

export default Service;
